function pop2x(sol, t)
    @unpack l2 = sol.prob.p
    @inbounds q1, q2, q3, q4, q5, q6, q7, u1, u2, u3, u4, u5, u6, u7 = sol(t)

    return q1 - l2 * cos(q3 - q4 - q5 - q6 - q7)
end

